$.data.data.status&&$.data.data.types<js>(function(result){
     var sp = new String(result).split(",");
     var l = [];
     for (var i = 0; i < sp.length; i++){
          var current = sp[i];
          current = current.trim();
          var index = current.indexOf("=");
          var key = current.slice(0, index).replace("{","").replace(" ","");
          if (key != "tag_name"){
              continue;
          }
          var value = current.slice(index + 1).replace("}","");
          l.push(value);
     }
     return l;
})(result);
</js>

