@js:
let list = [];
let doc = org.jsoup.Jsoup.parse(result);
for (;;) {
    let arr = doc.select('amp-state[id^="chapter"] > script').toArray().map(e => String(e));
    for (let x = 0; x < arr.length; x++) {
        let text = arr[x];
        let u = JSON.parse(arr[x].match(/<script.*?>(.*)<\/script>/)[1].replace(/baozicdn/,'baozimh'));
        list.push(u.url);
    }
    nextNode = doc.select('#next-chapter');
    if (!String(nextNode.text()).match(/下一页/)) break;
    nextUrl = String(nextNode.attr('href'));
    doc = org.jsoup.Jsoup.connect(nextUrl).get();
}
list;@Header:{Referer:"https://cn.bzmanga.com/"}

